var cityData = [{name: "宝安", city:"深圳市",prov:"广东",value: 153,rank:100,intro:"宝安南接深圳经济特区，北连东莞市，东濒大鹏湾，临望香港新界、元朗，是现代化经济中心城市深圳的工业基地和西部中心。"},
                {name: "上海", city:"浦东新区",prov:"上海",value: 3953,rank:100,intro:"上海是全球第二大期货交易中心，仅次于芝加哥；全球最大黄金现货交易中心；全球第二大钻石现货交易中心,全球三大有色金属定价中心之一。上海钢材市场共30余家，其中3个典型的市场宝山钢市、上海大创钢材现货交易市场、上海松江钢材市场。"},
                {name: "义乌", city:"金华市",prov:"浙江",value: 13471,rank:1,intro:"联合国，世界银行、摩根士丹利等国际权威机构联合发布《震惊世界的中国数字》报告中，义乌市场被称为“全球最大的小商品批发市场”。"},
                {name: "温州", city:"温州市",prov:"浙江",value: 7704,rank:2,intro:"基地”之美誉，中国鞋类出口基地“中心”之美誉中国人参鹿茸冬虫夏草集散中心，中国印刷材料交易中心。"},
                {name: "永康", city:"金华市",prov:"浙江",value: 2465,rank:6,intro:"永康是全国闻名的“五金之都”。五金产业是永康的支柱产业，全市有五金机械企业1万余家，产品涵盖机械五金、装潢五金、日用五金、建筑五金、工具五金、小家电等1万多种品种，五金工业产值占全市工业总产值的90%左右，上缴税收占全市财政收入的90%左右。"},
                {name: "宁波", city:"宁波市",prov:"浙江",value: 3456,rank:3,intro:"宁波是长江三角洲南翼经济中心和化学工业基地，即是中国华东地区的工商业城市，也是浙江省经济中心。自从古代宁波开埠以来，工商业一直是宁波的一大名片。特别是改革开放以来，宁波经济持续快速发展，显示出巨大的活力和潜力，成为国内经济最活跃的区域之一"},
                {name: "乐清", city:"温州市",prov:"浙江",value: 2134,rank:7,intro:"乐清市场网络健全，全市拥有生产资料和消费品贸易专业市场82个，其中较大规模的10个，年总成交额43.6多亿元;柳市低压电器专业市场分别被称为“中国电器之都”。"},
                {name: "云和", city:"丽水市",prov:"浙江",value: 158,rank:100,intro:"改革开放以来，云和的经济建设和社会各项事业得到了长足的发展，形成了以木制玩具、金属加工、轴承、小水电、食用菌、水干果等产业为龙头，以个体、私营经济为主体的区域特色经济。"},
                {name: "余姚", city:"宁波市",prov:"浙江",value: 1878,rank:10,intro:"余姚社会经济综合发展指数和县域经济基本竞争力分别位居全国第18位和第9位。拥有全国专业市场：中国塑料城、中国轻工模具城、中国裘皮城、中国有色金属材料城、梁弄灯具城。"},
                {name: "台州", city:"台州市",prov:"浙江",value: 2952,rank:4,intro:"台州是中国模具之都，国家级高精（高端）模具产业升级示范区，中国医药之都，中国家用轿车之都，中国汽车用品饰品之都，中国汽车及零部件出口基地，中国缝制设备制造之都　，中国摩托车之都，中国塑料制品之都，中国缝纫机之都，中国工艺礼品之都，中国阀门之都，国家级浙江化学原料药基地，中国再生金属之都，中国喷雾器之都，中国罐头食品之都等。"},
                {name: "天台", city:"台州市",prov:"浙江",value: 634,rank:100,intro:"位于浙江省东部，以境内天台山得名，总面积1420.70平方公里，属亚热带季风气候型，四季分明，温暖湿润，气候宜人。水资源年平均总量12.37亿立方米，水质良好。矿藏有金、银、铜、铅、锌等20种。"},
                {name: "平阳", city:"温州市",prov:"浙江",value: 1334,rank:13,intro:"平阳全县民营企业的数量占全县企业总数的95%以上、产值占全县的98.1%。规模工业迅速发展，产值超亿元的企业10家，超1000万元的企业94家，超500万元的企业138家，企业集团13家。产品档次和质量不断提高，拥有国家、省、市级名牌产品30多个。"},
                {name: "慈溪", city:"宁波市",prov:"浙江",value: 2092,rank:8,intro:"慈溪县域经济基本竞争力，全国同级城市排名第三位，是长江三角洲南翼的工商名城，是具有国际影响国内一流的生产和制造基地，诸多行业已经形成产业集群。目前，慈溪人均GDP已超过8000美元，进入了工业化中后期以及城市化加速发展的重要关口，对城市的综合承载功能和支撑能力提出更高更新的要求。"},
                {name: "杭州", city:"杭州市",prov:"浙江",value: 2929,rank:5,intro:"浙江省省会，副省级城市，浙江省第一大城市，也是长江三角洲经济圈两个副中心城市之一。"},
                {name: "柯桥", city:"绍兴市",prov:"浙江",value: 1258,rank:14,intro:"城市经济蓬勃发展，成为最具活力、最有潜力的经济增长点。各类专业市场发达，有纺织品、服装、鞋革、纺机、汽车、副食品、果蔬、农副产品批发等专业市场，尤其是亚洲最大的纺织品集散中心“中国轻纺城”座落其中，贸易中心、物流中心比比皆是。"},
                {name: "桐乡", city:"嘉兴市",prov:"浙江",value: 1916,rank:9,intro:"桐乡列入全国首批开放县（市），实行全方位的改革开放，极大地推动了桐乡社会经济文化发展，素有“鱼米之乡、丝绸之府、百花地面、文化之邦”之美誉。"},
                {name: "建德", city:"杭州市",prov:"浙江",value: 340,rank:100,intro:"2009年根据杭州市新一轮市域总体规划将建德定位于“杭州西部综合交通枢纽和区域级旅游集散中心”。"},
                {name: "瑞安", city:"温州市",prov:"浙江",value: 1352,rank:12,intro:"瑞安市，为中国浙江省下辖的县级市，由地级温州市代管。瑞安，位居我国黄金海岸线中段，地处上海经济区和厦漳泉金三角之间。这里气候宜人，物资产丰富，属江南鱼米之乡。自古市井繁华，商贸发达，人文荟萃，郭沫若曾题联“玉成桃李，海涌波澜”。"},
                {name: "桐庐", city:"杭州市",prov:"浙江",value: 600,rank:100,intro:"各项经济指标仍旧保持浙西地区首位，继续保持“浙西首县”地位。 改革开放以来，桐庐的工业经济发展迅猛，初步行成制笔、服装、针纺织、玩具、箱包、生物制药、皮革、机械、电子等优势产业。近年来，政府重视生态环境保护和资源集约利用，倡导走能耗底、污染少、资源消耗少、技术含量高、经济效益好的新型工业化道路。"},
                {name: "横店", city:"金华市",prov:"浙江",value: 797,rank:100,intro:"横店街道拥有镇办企业180多家，村联户办企业1600多家，其中特大型乡镇企业横店集团下辖17家全资或控股子公司和1家进出口总公司，下辖205家紧密型骨干企业，3家境外企业和多家境外研发机构，并在国内各主要城市建有30多个生产基地和贸易窗口；此外，还有1000多家半紧密型和松散型企业。"},
                {name: "永嘉", city:"温州市",prov:"浙江",value: 898,rank:100,intro:"中国泵阀之乡、中国拉链之乡、中国钮扣之都、中国教玩具之都"},
                {name: "东阳", city:"金华市",prov:"浙江",value: 797,rank:100,intro:"工业经济发展势头迅猛，全市逐步形成了以磁性电子、医药化工、针织服装、工艺美术、建筑建材等为五大支柱的产业结构。"},
                {name: "临安", city:"杭州市",prov:"浙江",value: 419,rank:100,intro:"2009年，临安全市坚果产业实现产值约50亿元，占全国坚果食品行业比重超20%。目前，临安的坚果炒货产品有山核桃、碧根果、杏仁、夏威夷果等30多个品种，销售市场覆盖全国近30个省市和欧美、中东、东南亚等国家，已成为全国最大的坚果食品生产、加工、销售集散地。"},
                {name: "临海", city:"台州市",prov:"浙江",value: 597,rank:100,intro:"临海是浙江中部沿海的一座古城新市，属沿海经济开放区。1997年国内生产总值57.24亿元，全市工业企业有6200多家，服装、机电、化工、建材、轻纺、食品饮料成为主要产业，并逐步走上集约化经营轨道，规模效益开始显现。杜桥眼镜市场成为全国四大眼镜市场之一。"},
                {name: "丽水", city:"丽水市",prov:"浙江",value: 597,rank:100,intro:"丽水是浙江省辖地级市，位于该省西南部、南邻福建，古称处州，始名于589年（隋文帝开皇九年），是浙西南的政治、经济、文化中心。全市总面积17298平方公里，常住人口211.70万，是浙江省面积最大而人口最稀少的地区。下辖莲都区及景宁畲族自治县、缙云、青田、遂昌、云和、庆元、松阳七县，代管县级龙泉市。"},
                {name: "浦江", city:"金华市",prov:"浙江",value: 817,rank:100,intro:"浦江被认定为“中国挂锁基地”和“全国纺织产业‘十二五’共建试点地区”。 花边、竹编、草编、麦秆贴画和绒绣为浦江传统工艺品的“五朵金花”。绗缝家纺、挂锁、水晶饰品、自行车和LED产业后来居上，成为新的经济增长点。"},
                {name: "温岭", city:"台州市",prov:"浙江",value: 897,rank:100,intro:"中国工具名城、中国帽业名城、中国鞋业名城、中国鞋类出口基地、中国海虾之乡、全国第一家股份合作制企业诞生地、中国泵业名城、中国帽业名城、中国水泵出口基地、中国空压机出口基地、中国小型电机出口基地、国家级电机质量检测基地、中国高橙之乡"},
                {name: "玉环", city:"台州市",prov:"浙江",value: 637,rank:100,intro:"玉环是全国最大的中低压铜制阀门生产和出口基地。低压阀门占国内出口市场50%左右，内销市场占有率50%以上，已覆盖全国各个市场。2003年，阀门行 业年产值近70亿元，其中出口30亿元，约占全国同类产品外贸出口的50%。"},
                {name: "宁海", city:"宁波市",prov:"浙江",value: 755,rank:100,intro:"宁海工业经济是全县国民经济的主体，以纺织服装、机械电子、食品饮料、橡胶制品、金属制品等行业为支柱的工业格局初步形成。宁海经济开发区是省级经济开发区和全国乡镇企业示范区。"},
                {name: "金华", city:"金华市",prov:"浙江",value: 7146,rank:100,intro:"以义乌产业带、永康五金城、义乌服装服饰批发商圈、义乌家居批发商圈、义乌围巾批发商圈、义乌小商品批发商圈、义乌国际小商品城七大产业带领跑全国。"},
                {name: "上虞", city:"绍兴市",prov:"浙江",value: 818,rank:100,intro:"上虞位于浙江省东北部，是一个产业发达、经济繁荣的城市。工业支撑作用明显，形成了机电、化工、轻纺、建材、食品等五大行业，以及伞件、铜管、手套袜业、电光源、汽配等八大块状经济。"},
                {name: "安吉", city:"湖州市",prov:"浙江",value: 377,rank:100,intro:"安吉县是长江三角洲经济区迅速崛起的一个对外开放景区。工业经济扩容提质。园区面积从15平方公里增加到36平方公里，开发区综合实力跃居全省三强，天子湖工业新城迅速崛起，临港经济区拉开框架，工业实现集中布局。安吉椅业列入省级现代产业集群转型升级示范区。"},
                {name: "富阳", city:"杭州市",prov:"浙江",value: 419,rank:100,intro:"“中国白板纸基地”、“中国球拍之乡”三大产业品牌，经济社会综合发展指数列全国发达县（市）第30位，财政收入连续多年进入全省十强县（市）行列，被有关机构分别评为中国大陆最适宜民营企业投资创业百强城市和长三角最具投资价值十强县（市），还荣获了“中国十大特色休闲基地”和浙江旅游十大“城市金名片”称号。"},
                {name: "平湖", city:"嘉兴市",prov:"浙江",value: 651,rank:100,intro:"平湖，属嘉兴辖区之一，是国家级生态示范区，西瓜之乡 ，糟蛋之乡，瓜灯之城， 服装名城 ，叔同故里国家火炬计划平湖光机电产业基地。"},
                {name: "瓯海", city:"温州市",prov:"浙江",value: 956,rank:100,intro:"瓯海将以瓯海城市中心区和温州新火车站站前区为龙头，融合两大区块，近期建成面积25平方公里、人口25万的新城框架。同时，依托区位优势、资源优势和产业优势，加快调整经济结构和转变增长方式，全力打造科技轻工区、现代商贸区、都市休闲区和新兴文教区，使瓯海成为宜商、宜居、宜游、宜创业的现代化新城区。"},
                {name: "磐安", city:"金华市",prov:"浙江",value: 280,rank:100,intro:"磐安工业园区为浙江省海拔最高的省级工业园区。中国香菇之乡。"},
                {name: "织里", city:"湖州市",prov:"浙江",value: 1637,rank:11,intro:"浙江织里童装名镇发展近40年，童装生产企业达到8000余家，印花、绣花、罗纹、辅料企业有2316家，占国内市场1/3左右，年销售额超300亿元，规模居全国之首。"},
                {name: "苍南", city:"温州市",prov:"浙江",value: 3190, intro:"农村经济结构不断优化，形成了优质粮、磨菇、马蹄笋、生猪、蔬菜、席草、水产、食草动物、禽蛋等十大效益农业基地，为农副产品加工业提供了充裕的资源。工业经济发展势头强劲，形成了印刷包装、塑料制品、轻纺、商务礼品、仪器仪表、食品加工等多个工业支柱产业。"},
                {name: "诸暨", city:"绍兴市",prov:"浙江",value: 1077,rank:100,intro:"拥有袜业、珍珠、铜加工及新型材料、机电装备制造、纺织服装、环保新能源等六大工业产业集群，位居福布斯大陆最佳商业城市第15位，中国百强县市前15强，成为首批国家现代农业示范区。被誉为“中国袜业之都”、“中国珍珠之都”、“中国香榧之都”。"},
                {name: "鹿城", city:"温州市",prov:"浙江",value: 790,rank:100,intro:"温州工业经济的主导行业有电气制造业、鞋革制造业、通用设备制造业、电力生产和供应业、塑料制造业、服装制造业、交通运输设备制造业、化学原料及化学制品制造业、金属制品业、黑色金属冶炼及压延加工业这十大行业。"},
                {name: "黄岩", city:"台州市",prov:"浙江",value: 1166,rank:100,intro:"黄岩区农业素有“黄岩熟，台州足”的誉称。农业以种植水稻、柑橘为主，特产黄岩蜜橘驰名中外，为世界柑橘始祖之一，具有2300余年的悠久历史，在唐代便被列为贡品，现有180多个品种品系，有“中国蜜橘之乡”美誉。"},
                {name: "海宁", city:"嘉兴市",prov:"浙江",value: 1080,rank:100,intro:"海宁皮革，以其浓厚的产业基础、驰名的产品质量、兴旺的皮革市场、领先的技术优势、良好的商业信誉而享誉国内外，被中国皮革协会命名为“中国皮革之都”。"},
                {name: "桥头", city:"宁波市",prov:"浙江",value: 600,rank:100,intro:"系中国最佳投资环境百强镇，浙江省小城镇综合改革试点镇，温州30经济强镇。2002年，“中国拉链之乡”、“中国纽扣之都”先后实至名归。"},
                {name: "深圳", city:"深圳市",prov:"广东",value: 153,rank:100,intro:"全国经济中心城市，是中国大陆经济效益最好的城市之一。中国电子第一街“华强北”。"},
                {name: "南通", city:"南通市",prov:"江苏",value: 153,rank:100,intro:"南通市位于江苏省东南部，是中国首批对外开放的14个沿海城市之一，地处长江三角洲北部，与中国经济最发达的上海及苏州隔江相望，被誉为“北上海”。 优势产业为家纺、纺织、皮革、MRO、五金、工具、机械、电子等，经济总量排名全国地级市第8位。"},
                {name: "无锡", city:"无锡市",prov:"江苏",value: 153,rank:100,intro:"无锡集成电路产业。充分利用中国南方微电子工业基地的产业基础和人才基础，依托海力士—意法半导体等重点骨干企业和58所等研究机构，构建集研发、设计、生产、销售于一体的完整IC产业链条，形成国内规模最大的集成电路生产基地和具有全球影响力的IC产业集群。"},
                {name: "苏州", city:"苏州市",prov:"江苏",value: 1363,rank:100,intro:"苏州风物雄丽为东南冠，经济发达。 苏州是长江三角洲经济圈北翼重要的副中心城市之一，苏州作为一座现代化程度较高的城市，是江苏省重要的经济、对外贸易、工商业中心和重要的文化、艺术、教育和交通枢纽，同时中国最具经济活力城市、国家卫生城市、国家环保模范城市和全国文明城市之一。"},
                {name: "龙岗", city:"深圳市",prov:"广东",value: 153,rank:100,intro:"龙岗区是“全国科技进步先进城区”、“全国科技进步示范区”及“全国科普示范城区创建单位”。目前，龙岗区进入新的发展周期，经济总量占深圳市经济的比重不断提升，经济发展呈现出又好又快的势头。"},
                {name: "荔湾", city:"广州市",prov:"广东",value: 153,rank:100,intro:"荔湾区现有各类市场214个，其中鞋业、花卉、茶叶等批发市场已成为远近闻名的大型专业批发市场。以站西路为例，在不到0.5平方公里的范围里，聚集16家有规模上档次的大型鞋城，经营面积约27万平方米，年交易总额超过10亿元，形成了鞋业“金三角”。"},
                {name: "番禹", city:"广州市",prov:"广东",value: 153,rank:100,intro:"番禺按照高新技术产业、先进制造业和服务业“三轮驱动”的发展思路，加快建立现代产业体系的步伐，围绕汽车及零配件、船舶配套、数字家庭、数控机床、输配变电、生物医药、精细化工、动漫游戏等优势产业。"},
                {name: "福田", city:"深圳市",prov:"广东",value: 153,rank:100,intro:"深圳市的电子信息产业规模居全国首位，其中计算机、程控交换机产量和软件出口全国第一。“中国电子第一街”，创造了国内同类市场的四项全国第一：销售额第一、电子专业市场经营面积第一、经营电子产品种类第一、商业覆盖率第一。"},
                {name: "广州", city:"广州市",prov:"广东",value: 153,rank:100,intro:"广州有着两千多年的历史，是中国历史文化名城，中国最大、历史最悠久的对外通商口岸，海上丝绸之路的起点之一，有“千年商都”之称。作为中国对外贸易的窗口和国家门户城市，广州外国人士众多，被称为“第三世界首都”，是全国华侨最多的城市，与北京、上海并称“北上广”。"},
                {name: "铜山", city:"徐州市",prov:"江苏",value: 490,rank:100,intro:"食品、机械、钢铁、汽车、电子等五大产业是铜山的优势主导产业，关联度较高，配套能力强。全县规模以上工业企业发展到237家，年销售收入超亿元企业达到36家，规模以上工业增加值连续多年位居苏北第一位，纳税额超过500万元的企业达到26家。"},
                {name: "常熟", city:"苏州市",prov:"江苏",value: 490,rank:100,intro:"常熟市位于中国经济最活跃的区域——上海经济圈中心，东倚上海，南接苏州，西邻无锡，北枕长江与南通隔江相望，具有得天独厚的区位优势。近20年经济增长一直保持在15%以上，综合实力显著增强。特别是近几年来，外向型经济发展迅猛，投资环境不断改善。"},
                {name: "常州", city:"常州市",prov:"江苏",value: 490,rank:100,intro:"常州是近代中国民族工商业的发祥地。常州正在成为国内优势明显、潜力巨大的现代装备制造城。被誉为“中国实业之父”和“中国商父”的常州人盛宣怀倾注毕生精力从事近代工矿交通事业，创造了第一家电信企业等11项“中国第一”。清末民初，常州纺织、机械、食品等近代工业得到较快发展。"},
                {name: "丹徒", city:"镇江市",prov:"江苏",value: 490,rank:100,intro:"丹徒区位于镇江市中部，创业型城市建设效果显著，新发展私营企业794家、个体工商户1940户，新增私个注册资本58亿元。"},
                {name: "丹阳", city:"镇江市",prov:"江苏",value: 490,rank:100,intro:"丹阳是一座现代化工贸城市，眼镜、五金工具、汽车零部件、木业、医疗器械等产业规模较大，是“中国眼镜生产基地”，亚洲最大的铝箔、钻头、人造板制造基地。"},
				{name: "东海", city:"连云港市",prov:"江苏",value: 490,rank:100,intro:"东海县东濒黄海，南接宿迁，西连徐州，北邻山东，是全国首批沿海开放县之一，是新亚欧大陆桥西行第一县，是闻名中外的“中国水晶之都”。"},
				{name: "高邮", city:"扬州市",prov:"江苏",value: 490,rank:100,intro:"高邮市地处长江三角洲，位于江苏沿江经济开放带的北侧，京沪高速公路和京杭大运河纵贯全市南北，运河大桥、湖区漫水公路和高邮、珠湖船闸连接运河东西。因秦王嬴政时筑高台、置邮亭，故名高邮，别称秦邮，“华夏一邮邑，神州无同类”，是全国2000多个县市中唯一以“邮”命名的城市。高邮经济发达、交通便捷、商业繁荣、人文荟萃、环境优美、资源丰富，现正在建设成为古代文化和现代文明交相辉映的城市。"},
				{name: "金阊", city:"苏州市",prov:"江苏",value: 490,rank:100,intro:"金阊区以商贸、物流、旅游三大板块为重点，以石路步行街改造、山塘历史街区保护性修复、金阊新城建设三大重点工程为依托，大力发展三产服务业，全面发展各项社会事业，“三个文明”建设齐步推进。2004年全区实现地区生产总值近40亿元，同口径增长22%；全口径财政收入突破10亿元，增长32%；地方一般预算收入超过5亿元，增长42%。"},
				{name: "南京", city:"南京市",prov:"江苏",value: 490,rank:100,intro:"是中国四大古都之一，有“六朝古都”、“十朝都会”之称。南京位于长江下游，是承东启西的枢纽城市，国家重要门户城市，华东地区中心城市和重要产业城市，长江航运物流中心，滨江生态宜居之城，联合国人居署特别荣誉奖获得城市。"},
				{name: "南通", city:"南通市",prov:"江苏",value: 490,rank:100,intro:"南通，中国历史文化名城，中国首批对外开放的14个沿海城市之一，位于江苏省东南部，东抵黄海，南望长江，“据江海之会、扼南北之喉”，地处长江三角洲北部，与中国经济最发达的上海及苏州隔江相望，被誉为“北上海” 。"},
				{name: "沭阳", city:"宿迁市",prov:"江苏",value: 490,rank:100,intro:"沭阳全县拥有国家二、三级园林绿化施工资质企业有50家，公司资产在百万元以上花木企业有32家。被授予“江苏省苗木产业基地”称号。"},
				{name: "睢宁", city:"徐州市",prov:"江苏",value: 490,rank:100,intro:"睢宁处于徐州市东南部，徐连经济带的中心区域，是江苏省规划建设的三大特大城市圈之一徐州特大城市圈“一城两翼”的重要一翼。"},
				{name: "太仓", city:"苏州市",prov:"江苏",value: 490,rank:100,intro:"太仓市属于苏州地区，太仓文化底蕴丰厚，工业发展迅速，是苏州地区高速发展的行政区，经济增速位居苏州市域第一位，太仓也是中国经济最为发达的县市之一，2012年列全国百强县（市）第四位。"},
			    {name: "维扬", city:"杨州市",prov:"江苏",value: 490,rank:100,intro:"维扬区已形成汽配工业、机电工业、休闲娱乐用品工业、纤纺服装工业四大支柱行业以及工艺、食品、生物基因工程、电子通信、光学材料等新型行业全面发展的格局。全区有10家企业产品在全省同行中处于前10名，唐城坯布、江扬电缆、久扬渔具、亚连钢管等产品获省级名牌产品。"},
			    {name: "无锡", city:"无锡市",prov:"江苏",value: 490,rank:100,intro:"无锡，简称“锡”，古称梁溪、金匮，被誉为“太湖明珠”。无锡市位于长江三角洲平原腹地，江苏南部，太湖流域的交通中枢，京杭大运河从中穿过。无锡北倚长江，南濒太湖，东接苏州，西连常州，构成苏锡常都市圈。"},
			    {name: "吴江", city:"苏州市",prov:"江苏",value: 490,rank:100,intro:"省先进装备制造业特色产业基地，顺利通过省级生态工业园区考核验收，成功晋升为国家新型工业化（电子信息）产业示范基地；吴江汾湖经济开发区以创建国家高新技术开发区为目标，着力推进各项创建工作；盛泽镇依托中国东方丝绸市场的平台优势，全面启动新城建设，积极打造世界级纺织产销基地。"},
		   	    {name: "相城", city:"苏州市",prov:"江苏",value: 490,rank:100,intro:"相城是苏州中心城市发展空间的主导方向之一，是极具发展潜力和活力的新城区，正着力打造“水城、花城、商城、最佳生态休闲人居城”，逐步建设成为“苏州现代制造业副中心、商贸物流副中心和优美人居副中心”。"},
			    {name: "徐州", city:"徐州市",prov:"江苏",value: 490,rank:100,intro:"徐州地区机械制造业初具规模，形成了以徐工集团为核心的机械制造产品集群区域；形成了起重机、压路机、挖掘机、装载机等16个大类、80个系列，400多个工程机械品种研发生产的基地型产业发展态势。"},
			    {name: "扬州", city:"杨州市",prov:"江苏",value: 490,rank:100,intro:"扬州：中国历史文化名城。地处江苏省中部，长江下游北岸，江淮平原南端，是南京都市圈和上海经济圈的节点城市，国家重点工程南水北调东线水源地（三江口、江都水利枢纽）。"},
			    {name: "张家港", city:"苏州市",prov:"江苏",value: 490,rank:100,intro:"张家港经济实力始终位居全国县市前三甲。2011年，实现地区生产总值1850亿元，按常住人口计算，人均2.3万美元，地方一般预算收入142亿元。同时，教育、医疗、文化、社保等城乡社会事业实现高水平均衡发展。2011年，全市城镇居民人均可支配收入达到3.51万元，农村居民人均收入1.71万元。"},
			    {name: "镇江", city:"镇江市",prov:"江苏",value: 490,rank:100,intro:"镇江古时称“润州”，位于中国东部沿海、江苏南部、长江三角洲北翼中心，是南京都市圈核心层城市和国家级苏南现代化建设示范区重要组成部分，长江和京杭大运河在此汇就中国“江河立交桥”坐标，素有“天下第一江山”之美誉。"}];

